I was nominated by Chef @marcvetri to do the @luke_palladino 5-Min Chef’s Charity Cooking Challenge in support of CORE, Children of Restaurant Employees! I made a quick and delightful herb and provolone omelet 🍳 I’m donating $5 and nominating these chefs to participate next 🧑‍🍳 

@bobbyflay 
@mvoltaggio 
@chefjwaxman 
@adamperrylang 
@nancysilverton 

To donate you can go to the website: https://core.kindful.com/?campaign=1085752
Or go to @coregives and click on the link in bio 🔗
